procstep.procdesc:
This dataset was created using ESRI event mapping.  The route system is the Transportation Data and Analytics' linear referencing system (LRS).  The event source data are created from two tables stored in Oracle.  The tables are DYNSEG_TMSDESC and DYNSEG_TMS_SUMMARY.  The queries used to generate the event table are:
select * from dynseg_tmsdesc;
select * from dynseg_tms_summary;

After these records the two tables are processed in order to create additional attribute fields and finally create the finished event table that serves as the source for the PTMS dataset.  The processing steps include the following queries that are issued in an Microsoft Access database:

Delete null values from source table:
DELETE DYNSEG_TMSDESC.COUNTY, DYNSEG_TMSDESC.SITE From DYNSEG_TMSDESC WHERE (((DYNSEG_TMSDESC.COUNTY) Is Null)) OR (((DYNSEG_TMSDESC.SITE) Is Null));

Update the COSITE field:
"UPDATE DYNSEG_TMSDESC SET DYNSEG_TMSDESC.Cosite = [COUNTY] & [SITE];"

Add the "Portable" attribute to the correct records:
UPDATE DYNSEG_TMSDESC SET DYNSEG_TMSDESC.Sitetype2 = ""Portable"" WHERE (((DYNSEG_TMSDESC.SITETYPE)=""P""));

Add the "Telemetered" attribute to the correct records:
UPDATE DYNSEG_TMSDESC SET DYNSEG_TMSDESC.Sitetype2 = ""Telemetered"" WHERE (((DYNSEG_TMSDESC.SITETYPE)=""T""));

These next two queries remove and rename the field for specifying site type:
catCurr.Tables("DYNSEG_TMSDESC").Columns.Delete ("Sitetype")
catCurr.Tables("DYNSEG_TMSDESC").Columns("Sitetype2").Name = "Sitetype"

This next 2 steps are used to update the Classd field:
UPDATE DYNSEG_TMS_SUMMARY SET DYNSEG_TMS_SUMMARY.Classd = ""Yes"" WHERE (((DYNSEG_TMS_SUMMARY.TFlg)=""A""));

UPDATE DYNSEG_TMS_SUMMARY SET DYNSEG_TMS_SUMMARY.Classd = ""No"" WHERE (((DYNSEG_TMS_SUMMARY.TFlg)<>""A""));

The final step is to join the summary and description tables to create the final event source table for the ptms dataset:

SELECT DYNSEG_TMS_SUMMARY.AADT, DYNSEG_TMS_SUMMARY.KFCTR, DYNSEG_TMS_SUMMARY.DFCTR, DYNSEG_TMS_SUMMARY.TFCTR, DYNSEG_TMS_SUMMARY.YEAR_, DYNSEG_TMS_SUMMARY.Cosite, DYNSEG_TMS_SUMMARY.Classd, DYNSEG_TMSDESC.SECTION_, DYNSEG_TMSDESC.LOCATION, DYNSEG_TMSDESC.COMM, DYNSEG_TMSDESC.Active, DYNSEG_TMSDESC.Sitetype " & _
"INTO ptms_and_ttms " & _
"FROM DYNSEG_TMS_SUMMARY " & _
"INNER JOIN DYNSEG_TMSDESC ON DYNSEG_TMS_SUMMARY.Cosite = DYNSEG_TMSDESC.Cosite;

The last query selects the portable station types:
select * from ptms_and_ttms where Sitetype = 'Portable'
